

class BestLogical(object):
    def __init__(self, resultDic):
        self.resultDic = resultDic
        self.LowestDic = {}
        self.highestDic = {}
        self.finalDic = {}

    def get_LowestDic(self):
        return self.LowestDic

    def get_highestDic(self):
        return self.highestDic
    def get_finalDic(self):
        return self.finalDic

    def dicIntoCheckModel(self):
        for exchangeName, value in self.resultDic.items():
            for conName, conPrice in value.items():
                self.findThehighest(exchangeName,conName,conPrice)
                self.findTheLowest(exchangeName, conName, conPrice)
        self.findTheBestOption()

    def findTheLowest(self, exchangeName, conName, conPrice):
        temDic = [exchangeName,conPrice]
        if (conName in self.LowestDic) == False:
            self.LowestDic[conName] = temDic
        else:
            if self.LowestDic[conName][1] > conPrice:
                self.LowestDic[conName] = temDic

    def findThehighest(self, exchangeName, conName, conPrice):
        temDic = [exchangeName,conPrice]
        if (conName in self.highestDic) == False:
            self.highestDic[conName] = temDic
        else:
            if self.highestDic[conName][1] < conPrice:
                self.highestDic[conName] = temDic

    def findTheBestOption(self):
        for conName in self.LowestDic.keys():
            priceDifference = float(self.highestDic[conName][1]) - float(self.LowestDic[conName][1])
            if priceDifference >= 0.5:
                self.finalDic[conName] = [self.highestDic[conName][0],self.LowestDic[conName][0],priceDifference]



